import React from 'react';
import './topnav.css';
import dashicon from './dashboard.png';
import pipeicon from './pipeline.png';
import reporticon from './reports.png';

const TopNav = ({ onRouteChange }) => {
		return (
			<div className="topnav">
				<a href="../App.js">
				    <div className="navicon">
					  <img src={ dashicon } alt="Dashboard" height="40%" width="auto" />DASHBOARD
				    </div>
				  </a>
				  <a href="../App.js">
				    <div className="navicon">
					<img src={ pipeicon } height="40%" width="auto" alt="Pipeline" />PIPELINE
				    </div>
				  </a>
				  <a href="../App.js">
				    <div className="navicon">
					<img src={ reporticon } height="40%" width="auto" alt="Reports" />REPORTS
				    </div>
				  </a>
				<div className="signout" onClick={() => onRouteChange('signout')}>
				    SIGN OUT    
				 </div>
			</div>
		);
}

export default TopNav;
